getTrainData: async ({ from, to, date }) => {
  return [
    {
      number: '001А',
      from,
      to,
      date,
      departure: '08:00',
      arrival: '16:00',
      seats: [
        {
          id: '1A',
          type: 'купе',
          bookedSegments: ['Рузаевка-Пенза']
        },
        {
          id: '1B',
          type: 'купе',
          bookedSegments: []
        },
        {
          id: '2A',
          type: 'плацкарт',
          bookedSegments: ['Пенза-Москва']
        }
      ]
    }
  ];
}
